using Microsoft.AspNetCore.Mvc;
using Microsoft.Playwright;
using System.Management.Automation;

namespace SamplePdfExport.Controllers
{
    //Docker image: mcr.microsoft.com/playwright/dotnet:v1.40.0-jammy
    //NuGet\Install-Package Microsoft.Playwright -Version 1.40.0
    //NuGet\Install-Package Microsoft.PowerShell.SDK -Version 7.4.0
    //NuGet\Install-Package System.Management.Automation -Version 7.4.0
    // <PlaywrightPlatform>linux</PlaywrightPlatform> - Add to csproj property group 
    [ApiController]
    [Route("[controller]")]
    public class WeatherForecastController : ControllerBase
    {
        private static readonly string[] Summaries = new[]
        {
            "Freezing", "Bracing", "Chilly", "Cool", "Mild", "Warm", "Balmy", "Hot", "Sweltering", "Scorching"
        };

        private readonly ILogger<WeatherForecastController> _logger;

        public WeatherForecastController(ILogger<WeatherForecastController> logger)
        {
            _logger = logger;
        }

        [HttpGet(Name = "GetPdf")]
        public async Task<IActionResult> Get()
        {
            var base64String = "";
            string dataUrl = "data:image/png;base64," + base64String;

            using IPlaywright playwright = await CreatePlaywrightAsync();
            var options = new BrowserTypeLaunchOptions { Headless = true };
            await using var browser = await playwright.Chromium.LaunchAsync(options);

            await using var context = await browser.NewContextAsync();
            var page = await context.NewPageAsync();
            await page.GotoAsync(dataUrl, new PageGotoOptions { WaitUntil = WaitUntilState.NetworkIdle });

            byte[] output = await page.PdfAsync(new PagePdfOptions { Format = "A4", Landscape = false });

            return File(output, "application/octet-stream", "test.pdf");

        }

        private async Task<IPlaywright> CreatePlaywrightAsync()
        {
            try
            {
                return await Playwright.CreateAsync();
            }
            catch (PlaywrightException pe) when (pe.Message.Contains("Driver not found:"))
            {
                await OneTimeResourceInstallationAsync();
                return await CreatePlaywrightAsync();
            }
            catch (Exception)
            {
                throw;
            }
        }

        private async Task OneTimeResourceInstallationAsync()
        {
            try
            {
                using (PowerShell ps = PowerShell.Create())
                {
                    await ps.AddScript("pwsh bin\\Debug\\net8.0\\playwright.ps1 install chromium").InvokeAsync();
                }
            }
            catch (Exception) { throw; }
        }
    }
}
